import 'bootstrap/dist/css/bootstrap.min.css';
import {Container, Form, Card, Row, Button, Image, Col} from 'react-bootstrap';
import logo from '../../res/Canada_landscape.jpeg';
import './home.css';
import ExploreSearchComponent from './subcomponents/ExploreSearchComponennt';
import LeafsComponents from './subcomponents/LeafsComponents';
import TopLocations from './subcomponents/TopLocations';
const Home = () => {
  return (
    <div style={{position: 'relative'}}>
      <div style={{position: 'relative'}}>
        <img
          object-fit="contain"
          src={logo}
          class="sliderImage"
          style={{width: '100%', height: 400}}
        />
        <LeafsComponents />

        <ExploreSearchComponent />

        <TopLocations />
      </div>
    </div>
  );
};
export default Home;
